import React from 'react'

export default function ProductCard({ id, title, price }) {
    return (
        <div>
            <h2>{title}</h2>
            <p>{`Price: ${price}$`}</p>
            <img src="../img\socks.png" alt="" srcset="" />
        </div>
    )
}
